  return (
    <div className="Meaning">
      <h3>{props.meaning.partOfSpeech}</h3>
      {props.meaning.definitions.map(function(definition, index)
      {
        return (
          <div key={index}>
            <p>
              {definition.definition}
              <br />
              <em>definition.example</em>
              <br />
              <Synonyms synonymsa={definition.synonyms} />
            </p>
            </div>
        );
})}
    </div>
  )
}
